import React from "react";
import '../styles.css';

function SectionHead(props) {
    return (
        <div style={styles.cont} className="font-bold txt-primary">
            <h1 style={styles.title}>{props.title}</h1>
            <div style={styles.line}></div>
        </div>
    )
}

const styles={
    cont: {
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
        width: '100%',


    },
    line: {
        display: 'flex',
        flexGrow: '1',
        height: '3px',
        borderRadius: '5px',
        backgroundColor: 'var(--primary-clr)',
    },
    title:{
        fontSize: '1.75rem',
        marginRight: '20px',
    }


}

export default SectionHead;
